define( function( require ) {
  'use strict';

  var mp3 = 'data:audio/mpeg;base64,';
  var ogg = 'data:audio/ogg;base64,';

  return {
    start: function() {
      var audio = document.createElement( 'audio' );
      audio.setAttribute( 'autoplay', 'autoplay' );
      audio.setAttribute( 'preload', 'preload' );
      audio.setAttribute( 'loop', 'loop' );

      var source1 = document.createElement( 'source' );
      source1.setAttribute( 'type', 'audio/mpeg' );
      source1.setAttribute( 'src', mp3 );
      // source1.setAttribute( 'src', 'audio/jewel-crusher.mp3' );

      var source2 = document.createElement( 'source' );
      source1.setAttribute( 'type', 'audio/ogg' );
      source1.setAttribute( 'src', ogg );
      // source1.setAttribute( 'src', 'audio/jewel-crusher.ogg' );

      audio.volume = 0.2;

      audio.appendChild( source1 );
      audio.appendChild( source2 );

      document.body.appendChild( audio );
    }
  };
} );